import React, {useState} from 'react';
import arrow from './images/icon-arrow.svg';






const Email = ({error,errorMessage,emailEvent}) => {
    return(
        <form className='emailContainer'>
            <input onChange={emailEvent} type='email' placeholder='Email Address'></input>
            <input className='arrow' type='image' src={arrow} alt='arrow'/> 
            <img src={error} alt='error'></img>
            <p>{errorMessage}</p>
        </form>
    )
}



export default Email;
